import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBIcon,
  MDBCol,
  MDBView,
  MDBContainer,
  MDBFormInline,
  MDBAnimation,
  MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText
} from "mdbreact";
import CardExample from './event1';
import indian from './indianoil.png';
import dance from './music.png';
import comedy from './stage.png';
import beats from './bot.png';
import alumni from './team.png';
import sing from './singer.png';


class Sponsers extends React.Component {
    render() {
        return(
            <MDBContainer >
            <div>
            
     
          
            <h2>Our Previous Sponsers</h2>
            <br/><br/>
                <MDBRow align="center">
              <MDBCol md="3" lg="3" sm="4"><img src={indian} alt="" style={{width:"40%",margin:"1rem"}}/></MDBCol>
              <MDBCol md="3" lg="3" sm="4"><img src={alumni} alt="" style={{width:"40%",margin:"1rem"}}/></MDBCol>
              <MDBCol md="3" lg="3" sm="4"><img src={sing} alt="" style={{width:"40%",margin:"1rem"}}/></MDBCol>
              <MDBCol md="3" lg="3" sm="4"><img src={dance} alt="" style={{width:"40%",margin:"1rem"}}/></MDBCol>

            
              </MDBRow>
<br/>
              <MDBRow align="center">
              <MDBCol md="3" lg="3" sm="4"><img src={dance} alt="" style={{width:"40%",margin:"1rem"}}/></MDBCol>
              <MDBCol md="3" lg="3" sm="4"><img src={beats} alt="" style={{width:"40%",margin:"1rem"}}/></MDBCol>
              <MDBCol md="3" lg="3" sm="4"><img src={dance} alt="" style={{width:"40%",margin:"1rem"}}/></MDBCol>
              <MDBCol md="3" lg="3" sm="4"><img src={comedy} alt="" style={{width:"40%",margin:"1rem"}}/></MDBCol>
             
              </MDBRow>
           
                <br/><br/>
            
            </div>
            </MDBContainer>
        );
    }
}

export default Sponsers;
